import React from 'react';
import PropTypes from 'prop-types';

// Styling
import { Box, Text } from '../styles';
import SFooter from './styles';
import theme from '../../theme';

const Footer = ({ menus }) => (
  <SFooter as="footer" py={100} bg={theme.colors.black}>
    Hoi
  </SFooter>
);

Footer.defaultProps = {
  menus: false,
};

export default Footer;
